import './AccueilPage.css'; // Assurez-vous d'avoir un fichier CSS pour styliser votre page d'accueil

const AccueilPage = () => {
  return (
    <div className="accueil-page">
      <div className="left-sidebar">
        <h2>Factures ouvertes</h2>
        <h2>+ Créez votre première facture</h2>
        <h3>Non échues</h3>
        <h3>En retard (- de 30 jours)</h3>
        <h3>En retard (+ de 30 jours)</h3>
      </div>
      <div className="main-content">
        {/* Votre contenu principal */}
        <h1>Contenu principal de la page d'accueil</h1>
        {/* Insérez ici le diagramme circulaire */}
        <div className="pie-chart">
          <p>0,00 DT facture</p>
        </div>
      </div>
    </div>
  );
};

export default AccueilPage;
